Actionscript.script:
if(_parent.hp <= 0)
{
   stop();
   if(_parent.是否为敌人 == true and random(100) > 75)
   {
      _root.创建可拾取物("主唱光剑",1,_parent._x,_parent._y,true);
   }
   if(_parent.已加经验值 != true)
   {
      if(_parent.是否为敌人 == true)
      {
         _root.敌人死亡计数++;
         _root.gameworld[_parent.产生源].僵尸型敌人场上实际人数--;
         _root.gameworld[_parent.产生源].僵尸型敌人总个数--;
         _parent.计算经验值();
      }
      _parent.人物文字信息._visible = 0;
      _root.add2map(_parent,2);
      _parent.removeMovieClip();
   }
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
